import React, { Component } from 'react';
import axios from 'axios';

const BASE_URL = "https://my-json-server.typicode.com/themeland/netstorm-json/explore";

class ExploreTwo extends Component {
    state = {
        data: {
            preHeading: "Explore Local Collection",
            heading: "Discover Unique NFTs",
            btnText: "View All",
            exploreData: [
                {
                    id: "1",
                    img: "/img/auction_1.jpg",
                    title: "EIGHT",
                    owner: "Local Richard",
                    price: "1.5 ETH",
                    count: "1 of 1",
                    btnText: "Place a Bid"
                },
                {
                    id: "2",
                    img: "/img/auction_2.jpg",
                    title: "Domain Names (Local)",
                    owner: "Local John",
                    price: "2.7 ETH",
                    count: "1 of 1",
                    btnText: "Place a Bid"
                },
                {
                    id: "3",
                    img: "/img/auction_3.jpg",
                    title: "Trading Cards",
                    owner: "Arham",
                    price: "2.3 ETH",
                    count: "1 of 1",
                    btnText: "Place a Bid"
                },
                {
                    id: "4",
                    img: "/img/auction_4.jpg",
                    title: "Industrial Revolution",
                    owner: "Yasmin",
                    price: "1.8 ETH",
                    count: "1 of 1",
                    btnText: "Place a Bid"
                }
            ]
        },
        exploreData: []
    }

    componentDidMount(){
        axios.get(`${BASE_URL}`)
            .then(res => {
                this.setState({
                    data: res.data,
                    exploreData: res.data.exploreData
                })
            })
            .catch(err => console.log(err))
    }

    render() {
        return (
            <section className="explore-area">
                <div className="container">
                    <div className="row">
                        <div className="col-12">
                            {/* Intro */}
                            <div className="intro d-flex justify-content-between align-items-end m-0">
                                <div className="intro-content">
                                    <span>{this.state.data.preHeading}</span>
                                    <h3 className="mt-3 mb-0">{this.state.data.heading}</h3>
                                </div>
                                <div className="intro-btn">
                                    <a className="btn content-btn" href="/explore-1">{this.state.data.btnText}</a>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="row items">
                        {this.state.exploreData.map((item, idx) => {
                            return (
                                <div key={`edt_${idx}`} className="col-12 col-sm-6 col-lg-3 item">
                                    <div className="card">
                                        <div className="image-over">
                                            <a href="/item-details">
                                                <img className="card-img-top" src={item.img} alt={item.title} />
                                            </a>
                                        </div>
                                        {/* Card Caption */}
                                        <div className="card-caption col-12 p-0">
                                            {/* Card Body */}
                                            <div className="card-body">
                                                <a href="/item-details">
                                                    <h5 className="mb-0">{item.title}</h5>
                                                </a>
                                                <div className="seller d-flex align-items-center my-3">
                                                    <span>Owned By</span>
                                                    <a href="/author">
                                                        <h6 className="ml-2 mb-0">{item.owner}</h6>
                                                    </a>
                                                </div>
                                                <div className="card-bottom d-flex justify-content-between">
                                                    <span>{item.price}</span>
                                                    <span>{item.count}</span>
                                                </div>
                                                <a className="btn btn-bordered-white btn-smaller mt-3" href="/wallet-connect">
                                                    <i className="icon-handbag mr-2" />{item.btnText}
                                                </a>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            );
                        })}
                    </div>
                    <div className="row">
                        <div className="col-12 text-center">
                            <a id="load-btn" className="btn btn-bordered-white mt-5" href="#">{this.state.data.btn_2}</a>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}

export default ExploreTwo;
